import { Navigate, Outlet, useRoutes } from "react-router-dom"

import { CreateUserPage } from "@modules/user/routes/create-user-page.component"
import DefaultDashboardPage from "@modules/dashboard/routes/default-dashboard-page-component"
import MainLayout from "@shared/components/layout/main-layout.component"
import React from "react"
import { UpdateUserPage } from "@modules/user/routes/update-user-page.component"
import { UserListPage } from "@modules/user/routes/user-list-page.component"
import { useParams } from "react-router"

const App = () => {
	const routes = useParams()
	console.log(routes)
	return (
		<MainLayout>
			<Outlet />
		</MainLayout>
	)
}

const ProtectedRoutes = () => {
	const routes = [
		{
			path: "app",
			children: [
				{
					path: "",
					element: <Navigate to="/app/dashboard" />,
				},
				{
					path: "dashboard",
					element: <DefaultDashboardPage />,
				},
				{
					path: "users",
					children: [
						{ path: "/", element: <UserListPage /> },
						{ path: "create", element: <CreateUserPage /> },
						{ path: "update", element: <UpdateUserPage /> },
					],
				},
				{
					path: "other",
					children: [],
				},
			],
		},
	]

	return useRoutes([
		{
			path: "",
			element: <App />,
			children: routes,
		},
	])
}

export default ProtectedRoutes
